import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import * as ReactBootStrap from "react-bootstrap";
import Carousel from "react-bootstrap/Carousel";
import Form from "react-bootstrap/Form";
import Navbar from "react-bootstrap/Navbar";

// let img = document.querySelector("img");
// let box = document.getElementById("button");

// // if (box) {
// box.addEventListener("click", () => {
//   img.src = "https://i.imgur.com/21iJ3Qx.jpg";
//   console.log("test");
// });
// // }

class BottomNav extends Component {
  render() {
    return (
      <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
        <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="#features">Features</Nav.Link>
            <Nav.Link href="#pricing">Pricing</Nav.Link>
          </Nav>
          <Nav>
            <Nav.Link href="#deets">More deets</Nav.Link>
            <Nav.Link eventKey={2} href="#memes">
              Dank memes
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    );
  }
}

class Nav extends Component {
  render() {
    return (
      <ReactBootStrap.Navbar
        collapseOnSelect
        expand="xl"
        bg="dark" // dark, primary, danger
        variant="dark"
      >
        <ReactBootStrap.Navbar.Brand href="#home">
          Harpreet Randhawa
          <img src={logo} className="App-logo" alt="logo" />
        </ReactBootStrap.Navbar.Brand>
        <ReactBootStrap.Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <ReactBootStrap.Navbar.Collapse id="responsive-navbar-nav">
          <ReactBootStrap.Nav className="mr-auto" text-allign="center">
            <ReactBootStrap.Nav.Link href="#home">Home</ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="#resume" className="resume">
              Resume
            </ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="#aboutme">
              AboutMe
            </ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="#comments">
              Comments
            </ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="#contact">
              Contact
            </ReactBootStrap.Nav.Link>
          </ReactBootStrap.Nav>
          <ReactBootStrap.Nav>

          </ReactBootStrap.Nav>
        </ReactBootStrap.Navbar.Collapse>
      </ReactBootStrap.Navbar>
    );
  }
}

class Header extends Component {
  render() {
    return (
      <header className="App-header">
        <div className="container5">
          <div id="box">
            <img src="https://i.imgur.com/JpeUHd0.jpg" alt="Me" id="cover" />
          </div>
        </div>
        <br></br>
        <h1 className="App-title"> Welcome to my website!</h1>
      </header>
    );
  }
}

const AboutMe = () => {
  return (
    <div className="App-header-aboutme">
      <p> About Me Here </p>
    </div>
  );
};

const Resume = () => {
  return (
    <div className="App-header-resume">
      {/* <img src="https://i.imgur.com/rtPObQD.jpg" alt="resume" /> */}
      <img
        src="https://i.imgur.com/FRkdFhb.jpg"
        alt="resume"
        className="resume"
      />
    </div>
  );
};

const Contact = () => {
  return (
    <div className="App-header-contact">
      <Form>
        <Form.Group controlId="exampleForm.ControlInput1">
          <Form.Label>Email address</Form.Label>
          <Form.Control type="email" placeholder="name@example.com" />
        </Form.Group>
        <Form.Group controlId="exampleForm.ControlSelect1">
          <Form.Label>Example select</Form.Label>
          <Form.Control as="select">
            <option>1</option>
            <option>2</option>
            <option>3</option>
            <option>4</option>
            <option>5</option>
          </Form.Control>
        </Form.Group>
        <Form.Group controlId="exampleForm.ControlSelect2">
          <Form.Label>Example multiple select</Form.Label>
          <Form.Control as="select" multiple>
            <option>1</option>
            <option>2</option>
            <option>3</option>
            <option>4</option>
            <option>5</option>
          </Form.Control>
        </Form.Group>
        <Form.Group controlId="exampleForm.ControlTextarea1">
          <Form.Label>Example textarea</Form.Label>
          <Form.Control as="textarea" rows="3" />
        </Form.Group>
      </Form>
      <br></br>
      <p>Contact information</p>
      <p>Email: Harpreetsrandhawa99@gmail.com</p>
      <p>LinkedIn: https://www.linkedin.com/in/harpreet-randhawa-965695159/</p>
      <p>Phone Number: 848-228-6014</p>
    </div>
  );
};

const Comments = () => {
  return (
    <div className="App-header-comments">
      <Carousel>
        <Carousel.Item>
          <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
        </Carousel.Item>
        <Carousel.Item>
